export default class UIDesigns extends Component {
  render() {
    return (
      <div className="img-container">
          <img src="https://i.pinimg.com/736x/bc/9f/45/bc9f45faaabe200f75e8450fcf3b35a9.jpg" />
          <img src="https://i.pinimg.com/736x/bc/9f/45/bc9f45faaabe200f75e8450fcf3b35a9.jpg" />
          <img src="https://i.pinimg.com/736x/bc/9f/45/bc9f45faaabe200f75e8450fcf3b35a9.jpg" />
      </div>
    )
  }
}
